import React from 'react';
import Home from './Components/Home/Home';
import './App.css';

import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";



function App() {

  return (
      <div className="App">
    <Routes>
      <Route path='/' element={<Home/>}></Route>
    </Routes>
        </div >
  )
}

export default App;
